import React from 'react';
import { Collapse, Button } from 'react-bootstrap';
import Fields from './fieldset.jsx';
import styles from './workspace.module.css';

const Workspace = ({exploreOpen, handlePlus, counter, inputValue}) => {

    const datafield  =[{"box1":<input type="text"   value={inputValue}/>,
                        "box2":  <input type="text"   value={inputValue}/>,
                        "box3":  <input type="text"   value={inputValue}/>,
                        "box4":  <input type="text"   value={inputValue}/>,
    },
    {"box1":<input type="text" value="" />,
    "box2":  <input type="text" value="" />,
    "box3":  <input type="text" value="" />,
    "box4":  <input type="text" value="" />,
},{"box1":<input type="text" value="" />,
"box2":  <input type="text" value="" />,
"box3":  <input type="text" value="" />,
"box4":  <input type="text" value="" />,
}];
 const equal = "="
 const multiple = "x"
 const plus = "+"


    return ( 
        <div>
                <Collapse in={exploreOpen}>
                   <div id="example-collapse-text"  className={styles.formwrap}>
                   <Button onClick ={() => handlePlus()}>Plus</Button>


                   </div>
          </Collapse>
        </div>
     )
   };
   
   export default Workspace;


   
   <Collapse in={handlePlus}>
   <div id="example-collapse-text"  className={styles.formwrap}>
     
        {datafield.map((d, index)=>{
                return (<Fields key={index}>{d.box1}{equal}{d.box2}{multiple}{d.box3}{plus}{d.box4}</Fields>)
            })}
            </div>
</Collapse>
